def findmax(x):
    maxrec = x[0]
    for rec in x:
        if rec[4] > maxrec[4]:
            maxrec = rec
    return maxrec

longest = {}
for tax, stdname in species.items():
    for gene, list in stdname.items():
        new = findmax(list)
        if gene in longest:
            longest[gene].append(new)
        else:
            longest[gene] = [new]
